import Axios from 'axios';
import React from 'react';
import axios from 'axios';

const Hello = ({ quiz }: any) => {
  return <h1>{quiz}</h1>;
};

Hello.getInitialProps = async () => {
  // const X-Api-Key = 'lCYLQgZXpyARHxOsGt6qe59DiLJawH8CbOIwDLdl';
  const result = await axios.get('https://quizapi.io/api/v1/questions', {
    header: { 'X-Api-Key': 'lCYLQgZXpyARHxOsGt6qe59DiLJawH8CbOIwDLdl' },
  });
  console.log(result);

  return { quiz: result };
};

export default Hello;
